import react from 'react'
import BaseLayout from './BaseLayout'
import BackToTop from '../shared/BackToTop'

const ContentLayout = (props) => {
    return (
        <BaseLayout>
            {props.children}
            <BackToTop></BackToTop>
        </BaseLayout>
    )
}

export default ContentLayout;
